import React from 'react'
import { CardTitle, CardLink } from './Card.elements'

const Card = (props) => {
  return (
    <>
        <CardLink to={props.path}>
            {props.icon}
            <CardTitle>
                {props.title}
            </CardTitle>
        </CardLink>
    </>
  )
}

export default Card
